import React from "react";
import Link from "next/link";

export const Header = ({}) => {
  console.log("working");

  return (
    <div>
      <nav>
        <Link href="/">
          <a>Home</a>
        </Link>
        <Link href="/contact">
          <a>Contact</a>
        </Link>
        <Link href="/about">
          <a>About</a>
        </Link>
      </nav>
      <style jsx>{`
        a {
          display: inline-block;
          margin: 10px;
          text-decoration: none;
          color: black;
        }
        div {
          border-bottom: 1px solid black;
        }
        nav {
          display: flex;
        }
      `}</style>
    </div>
  );
};

export default Header;
